import React from "react";
import Footer from "../components/footer/footer";
import Header from "../components/header/header";
import SignIn from "../components/signIn/signIn";

const SignInPage = () => {
  return (
    <>
      <Header />
      <SignIn />
      <Footer />
    </>
  );
};

export default SignInPage;
